import React, { useState, useEffect } from 'react'
import './styles.css'
import HomePage from '../chat/HomePage'
import Login from '../chat/SignIn'
import Register from '../chat/Register'
import Dashboard from '../chat/Dashboard'
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles'
import { CssBaseline, CircularProgress } from '@material-ui/core'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import fire from '../../FirebaseConfig';

const theme = createMuiTheme()

export default function App() {

	const [fireInitialized, setfireInitialized] = useState(false)

	useEffect(() => {
		fire.isInitialized().then(val => {
			setfireInitialized(val)
		})
	})


	return fireInitialized !== false ? (
		<MuiThemeProvider theme={theme}>
			<CssBaseline />
			<Router>
				<Switch>
					<Route exact path="/" component={HomePage} />
					<Route exact path="/login" component={Login} />
					<Route exact path="/register" component={Register} />
					<Route exact path="/dashboard" component={Dashboard} />
				</Switch>
			</Router>
		</MuiThemeProvider>
	) : <div id="loader"><CircularProgress /></div>
  }
